import React, { Component } from "react";
import "./ContactForm.css";

class ContactFrom extends Component {
  state = {};

  submitForm = event => {
    event.preventDefault();
  };

  render() {
    return (
      <div className="contact_form">
        <div className="form">
          <form onClick={this.submitForm}></form>
        </div>
      </div>
    );
  }
}

export default ContactFrom;
